// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";

contract msnftold is ERC721 {
    // Co-signers
    address[] public coSigners;

    // Number of required signatures
    uint8 public requiredSignatures;

    // Proposals
    struct Proposal {
        uint id;
        address proposer;
        uint256 tokenId;
        uint8 action;
        bool approved;
    }
    Proposal[] public proposals;

    // Votes
    mapping(uint => mapping(address => bool)) public votes;

    // Total number of proposals
    uint public proposalCount;

    constructor(string memory name, string memory symbol, address[] memory _coSigners, uint8 _requiredSignatures) public ERC721(name, symbol) {
        coSigners = _coSigners;
        requiredSignatures = _requiredSignatures;
    }

    function propose(uint256 _tokenId, uint8 _action) public {
        proposals.push(Proposal(proposalCount, msg.sender, _tokenId, _action, false));
        proposalCount++;
    }

    function vote(uint _proposalId, bool _approval) public {
        Proposal storage proposal = proposals[_proposalId];
        require(coSigners.length > 0, "No co-signers found");
        require(proposal.proposer != msg.sender, "Proposer cannot vote");

        votes[_proposalId][msg.sender] = _approval;

        uint approvalCount = 0;
        for (uint i = 0; i < coSigners.length; i++) {
            if (votes[_proposalId][coSigners[i]]) {
                approvalCount++;
            }
        }

        if (approvalCount >= requiredSignatures) {
            proposal.approved = true;

            if (proposal.action == 1) {
                transferFrom(proposal.proposer, msg.sender, proposal.tokenId);
            }
        }
    }

}
